import React from "react";
import "./Sidebar.css"; // Import the CSS

function Sidebar() {
  return (
    <div className="sidebar">
        <ul>
        <li id="profile"><img src="/Images/Threeline.png" style={{ width: '20px', height: '20px' }}/>Admin Profile</li>
        <li id="student">Student</li>
        <li id="cmp">Company</li>
        <li id="analysis">Analysis</li>
      </ul>
    </div>
  );
}

export default Sidebar;
